eval("module.exports = \"<template>\\n  <div class=\\\"content-header\\\">\\n    <span class=\\\"content-title\\\">\\n      <i class=\\\"fas fa-books\\\" style=\\\"color: #2589BD\\\"></i>\\n      <span style=\\\"color: white\\\">\\n        Books\\n      </span>\\n    </span>\\n  </div>\\n  <div class=\\\"content-body\\\">\\n    <br>\\n    A list of books I read and can recommend to you, enjoy!\\n    <br>\\n    <br>\\n    <span class=\\\"text-highlight\\\">About Technology & Science</span>\\n    <ul>\\n      <li>\\n        - <strong>Artificial Intelligence: A Modern Approach</strong> by\\n        Stuart Russell and Peter Norvig\\n        <br>\\n        <i class='booklist'>Introduction to the theory and practice of artificial intelligence.</i>\\n      </li>\\n      <li>\\n        - <strong>The Non-Designer's Design Book</strong> by Robin Williams\\n        <br>\\n        <i class='booklist'>Basic design principles explained very well.</i>.</i>\\n      </li>\\n      <li>\\n        - <strong>Visual Thinking for Design</strong> by Colin Ware\\n        <br>\\n        <i class='booklist'>Combining the science of perception and design.</i>.</i>\\n      </li>\\n      <li>\\n        - <strong>Pattern Recognition and Machine Learning</strong> by Christopher M. Bishop\\n        <br>\\n        <i class='booklist'>One of the machine learning bibles.</i>\\n      </li>\\n      <li>\\n        - <strong>Understanding The New Statistics: Effect Sizes, Confidence Intervals, and Meta-Analysis</strong> by\\n        Geoff Cumming\\n        <br>\\n        <i class='booklist'>One of the machine learning bibles.</i>\\n      </li>\\n      <li>\\n        - <strong>Fluent Python</strong> by\\n        Luciano Ramalho\\n        <br>\\n        <i class='booklist'>Behind the scenes of python.</i>\\n      </li>\\n      <li>\\n        - <strong>Visualization Analysis and Design: Principles, Techniques, and Practice</strong> by\\n        Tamara Munzner\\n        <br>\\n        <i class='booklist'>A comprehensive framework for thinking about visualizations.</i>\\n      </li>\\n      <li>\\n        - <strong>Machine Learning: A Probabilistic Perspective</strong> by\\n        Kevin P. Murphy\\n        <br>\\n        <i class='booklist'>Machine learning from a probabilistic perspective.</i>\\n      </li>\\n      <li>\\n        - <strong>Introduction to Information Retrieval</strong> by\\n        Christopher D. Manning, Prabhakar Raghavan and Hinrich Schütze\\n        <br>\\n        <i class='booklist'>Basics of information retrieval.</i>\\n      </li>\\n    </ul>\\n    <br>\\n    <span class=\\\"text-highlight\\\">About People & Psychology</span>\\n    <ul>\\n      <li>\\n        - <strong>The Righteous Mind: Why Good People Are Divided by Politics and Religion</strong> by Jonathan Haidt\\n        <br>\\n        <i class='booklist'>The most influental book I have read so far.</i>\\n      </li>\\n      <li>\\n        - <strong>Barking Up the Wrong Tree: The Surprising Science Behind Why Everything You Know About Success Is\\n          (Mostly) Wrong</strong> by Eric Barker\\n        <br>\\n        <i>Helped me to focus during hard times.</i>\\n      </li class='booklist'>\\n      <li>\\n        - <strong>Thinking Fast and Slow</strong> by Daniel Kahneman\\n        <br>\\n        <i class='booklist'>Some effects are not as strong as stated in the\\n          book but it is still an interesting book.</i>\\n      </li>\\n      <li>\\n        - <strong>Predictably Irrational</strong> by Dan Ariely\\n        <br>\\n        <i class='booklist'>Great book about human decision making.</i>\\n      </li>\\n      <li>\\n        - <strong>The Enigma of Reason</strong> by Hugo Mercier and Dan Sperber\\n        <br>\\n        <i class='booklist'>About human reasoning part of a science thriller around missing citations.</i>\\n      </li>\\n      <li>\\n        - <strong>The Power of Habit: Why We Do What We Do in Life and Business</strong> by Charles Duhigg\\n        <br>\\n        <i class='booklist'>Shows the huge power and danger of habits.</i>\\n      </li>\\n      <li>\\n        - <strong>The Language of Emotions: What Your Feelings Are Trying to Tell You</strong> by Karla McLaren\\n        <br>\\n        <i class='booklist'>Sometimes a little esoteric but full of insight.</i>\\n      </li>\\n      <li>\\n        - <strong>How to win Friends & Influence People</strong> by Dale Carnegie\\n        <br>\\n        <i class='booklist'>A classic about communication.</i>\\n      </li>\\n      <li>\\n        - <strong>Miteinander reden</strong> by Friedemann Schulz von Thun, Andreas Neumann, et al.\\n        <br>\\n        <i class='booklist'>Another classic about communication.</i>\\n      </li>\\n    </ul>\\n\\n    <span class=\\\"text-highlight\\\">About Society</span>\\n    <ul>\\n      <li>\\n        - <strong>Utopia for Realists: And How We Can Get There</strong> by Rutger Bregman\\n        <br>\\n        <i class='booklist'>Imagine a bright future.</i>\\n      </li>\\n      <li>\\n        - <strong>The Happiness Hypothesis</strong> by Jonathan Haidt\\n        <br>\\n        <i class='booklist'>Where does happiness come from and where does it go?</i>\\n      </li>\\n      <li>\\n        - <strong>Outliers: The Story of Success</strong> by Malcolm Gladwell\\n        <br>\\n        <i class='booklist'>Success is about being at the right time at the right place.</i>\\n      </li>\\n      <li>\\n        - <strong>Debt - Updated and Expanded: The First 5,000 Years</strong> by David Graeber\\n        <br>\\n        <i class='booklist'>Where does the concept of money come from?</i>\\n      </li>\\n      <li>\\n        - <strong>Homo Ludens: Vom Ursprung der Kultur im Spiel</strong> by Johan Huizinga\\n        <br>\\n        <i class='booklist'>A classic and influenced my workd view a lot.</i>\\n      </li>\\n      <li>\\n        - <strong>Von der Kürze des Lebens</strong> by Seneca\\n        <br>\\n        <i class='booklist'>Time is the only finite thing in our life.</i>\\n      </li>\\n    </ul>\\n\\n    <span class=\\\"text-highlight\\\">Novels</span>\\n    <ul>\\n      <li> - <strong>Siddhartha</strong> by Hermann Hesse</li>\\n      <li> - <strong>Brave New World</strong> by Aldous Huxley</li>\\n      <li> - <strong>American Gods</strong> by Neil Gaiman</li>\\n      <li> - <strong>The Expanse 1-8</strong> by James S. A. Corey </li>\\n      <li> - <strong>The Mistborn Trilogy 1-3</strong> by Brandon Sanderson </li>\\n      <li> - <strong>Das Geheimnis von Askir 1-7</strong> by Richard Schwartz </li>\\n      <li> - <strong>Die Götterkriege 1-7</strong> by Richard Schwartz </li>\\n      <li> - <strong>The Dresden Files 1-15</strong> by Jim Butcher </li>\\n      <li> - <strong>Codex Alera 1-6</strong> by Jim Butcher </li>\\n      <li> - <strong>Harry Potter 1-8</strong> by J.K. Rowling</li>\\n    </ul>\\n  </div>\\n</template>\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/about.html\n");

