eval("module.exports = \"<template>\\n  <div class=\\\"content-header\\\">\\n    <span class=\\\"content-title\\\">\\n      <i class=\\\"fas fa-analytics\\\" style=\\\"color: #2589BD\\\"></i>\\n      <span style=\\\"color: white\\\">\\n        Blackbox Viewer\\n      </span>\\n    </span>\\n  </div>\\n  <div class=\\\"content-body\\\">\\n    <div class=\\\"row\\\">\\n      <div class=\\\"col m4\\\">\\n    <p>\\n      The goal of BlackboxViewer\\n      <a class=\\\"link\\\" href=\\\"https://christoph.github.io/blackbox_viewer/\\\"><i class=\\\"fas fa-long-arrow-right\\\"></i>\\n        Online\\n        Tool</a>\\n      is to allow experts to <span class=\\\"text-highlight\\\">validate </span> and\\n      <span class=\\\"text-highlight\\\">analyze models</span> based on input and output values.\\n      All models are treated as black boxes without knowing their internals while supporting users in\\n      understanding such models.\\n    </p>\\n    <p>\\n      The left visualization in fig. 1 shows all input parameters, and the right one shows all output parameters\\n      of the loaded model. Through <span class=\\\"text-highlight\\\">brushing & linking</span>, the user can understand\\n      how different parametrizations result in different model outputs.\\n    </p>\\n\\n      </div>\\n      <div class=\\\"col m8\\\">\\n    <p>\\n      <img src=\\\"https://www.dropbox.com/s/62hdnpubyl6d29p/black.png?dl=1\\\" alt=\\\"Blackbox Viewer\\\"\\n        style=\\\"width: 100%\\\">Figure 1: Blackbox Viewer\\n      interface\\n      with a SIR model loaded and a brushed\\n      area in the\\n      susceptible\\n      output.</img>\\n\\n    </p>\\n\\n      </div>\\n    </div>\\n  </div>\\n</template>\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/black.html\n");

