eval("module.exports = \"<template>\\n  <div class=\\\"content-header\\\">\\n    <span class=\\\"content-title\\\"><span style=\\\"color: white\\\">Teaching</span></span>\\n  </div>\\n  <div class=\\\"content-body\\\">\\n    <!-- content -->\\n    <p>During the Winter semester, I teach <span class=\\\"text-highlight\\\">Visualization and Visual Data Analysis</span>\\n      (<a class=\\\"link\\\" href=\\\"http://vda.univie.ac.at/Teaching/Vis/19w/schedule.html\\\" style=\\\"display: inline-block;\\\"\\n        target=\\\"_blank\\\">Course page</a>) where I show students how to design visualizations and dashboards using Tableau\\n      as well as D3.js. During the Summer semester, I teach <span class=\\\"text-highlight\\\">Human Computer\\n        Interaction</span>(<a class=\\\"link\\\" href=\\\"http://vda.univie.ac.at/Teaching/HCI/19s/schedule.html\\\"\\n        style=\\\"display: inline-block;\\\" target=\\\"_blank\\\">Course page</a>) where I show students general design principles\\n      and how to use a user centered design process.\\n    </p>\\n    <p>Besides teaching at the university I also taught visualization principles on two <span\\n        class=\\\"text-highlight\\\">deep learning summer schools</span> (<a class=\\\"link\\\"\\n        href=\\\"https://datascience.univie.ac.at/news-events/data-science-summer-school-uni-vienna-2018/\\\"\\n        style=\\\"display: inline-block;\\\" target=\\\"_blank\\\">2018</a>, <a class=\\\"link\\\"\\n        href=\\\"https://datascience.univie.ac.at/news-events/detail-news/news/apply-for-data-science-summer-school-2019/?tx_news_pi1%5Bcontroller%5D=News&tx_news_pi1%5Baction%5D=detail&cHash=540a4cf17156c02bfd8de9010b16453a\\\"\\n        style=\\\"display: inline-block;\\\" target=\\\"_blank\\\">2019</a>) and a qualification seminar for <span\\n        class=\\\"text-highlight\\\">professionals from industry</span> (<a class=\\\"link\\\"\\n        href=\\\"https://vda.cs.univie.ac.at/research/projects/project/306/\\\" style=\\\"display: inline-block;\\\"\\n        target=\\\"_blank\\\">Project Page</a>).\\n      We use <span class=\\\"text-highlight\\\">Tableau</span> during all Visualization courses and lectures. I created all\\n      of the tutorial materials for Tableau and created together with Raphael Sahann a video tutorial\\n      <a class=\\\"link\\\" href=\\\"https://github.com/Christoph/VIS_Tableau_Tutorial\\\" style=\\\"display: inline-block;\\\"\\n        target=\\\"_blank\\\">link</a>.\\n    </p>\\n    <p>I supervise students during bachelor thesis, master thesis and master projects. I am lucky to work with amazing\\n      students on interesting topics in different areas like:</p><span class=\\\"text-highlight\\\">Machine learning</span>\\n    <ul>\\n      <li>- Using deep neural networks to extract components from publications.</li>\\n      <li>- Validating multi-class classifiers.</li>\\n      <li>- Comparing dimensionality reduction methods.</li>\\n    </ul><span class=\\\"text-highlight\\\">Natural Language Processing</span>\\n    <ul>\\n      <li>- PDF structure analysis based on natural language processing.</li>\\n      <li>- Comparison of text embedding pipelines.</li>\\n      <li>- Visual CLustering of documents based on non-optimal embeddings.</li>\\n    </ul><span class=\\\"text-highlight\\\">Human Computer Interaction</span>\\n    <ul>\\n      <li>- Understanding human biases during usage of correlation visualizations.</li>\\n      <li>- Redesigning the ticket ordering process for train tickets.</li>\\n      <li>- Using gamification to teach employees about information security.</li>\\n      <li>- How to integrate 2nd screen applications during e-sports events.</li>\\n    </ul>\\n  </div>\\n</template>\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///pages/teaching.html\n");

